package errhandler

import (
	"context"
	"net/http"

	"github.com/clickyab/services/array"
	"github.com/mssola/user_agent"
)

const errTemplate = `
	<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <!-- The above 3 meta tags *must* come first in the head; any other head content must come *after* these tags -->
    <title>404 NOT FOUND</title>
    <style>
        html, body {
	margin: 0;
	padding: 0;
	background: #000000;
	position: relative;
	height: 100%;
        }
        .not-found {
        	position: absolute;
	top: 50%;
	left: 50%;
	transform: translate(-50%, -50%);
        }
         .not-found img {
         	max-width: 100%;
         	-moz-user-select: none;
	-webkit-user-select: none;
	user-select: none;
         }
    </style>
    <!-- HTML5 shim and Respond.js for IE8 support of HTML5 elements and media queries -->
    <!-- WARNING: Respond.js doesn't work if you view the page via file:// -->
    <!--[if lt IE 9]>
      <script src="https://oss.maxcdn.com/html5shiv/3.7.3/html5shiv.min.js"></script>
      <script src="https://oss.maxcdn.com/respond/1.4.2/respond.min.js"></script>
    <![endif]-->
  </head>
  <body>
    <div class="not-found">
    	<img id="404-img" src="data:image/png;base64," />
    </div>
    <script type="text/javascript">
    	function isRetinaDisplay() {
    		return window.devicePixelRatio > 1;
    	}

    	if (isRetinaDisplay()) {
    		var img = document.getElementById('404-img');
    		img.src = 'data:image/png;base64,';
    	}
    </script>
  </body>
</html>
`

var (
	browsers = []string{"Mozilla", "Opera", "Edge", "Chrome", "Chromium", "Internet Explorer"}
)

func errCheck(_ context.Context, w http.ResponseWriter, r *http.Request) {
	ua := user_agent.New(r.UserAgent())
	name, _ := ua.Browser()
	if array.StringInArray(name, browsers...) {
		w.WriteHeader(http.StatusNotFound)
		w.Write([]byte(errTemplate))
		return
	}
	w.WriteHeader(http.StatusNotFound)
	w.Write([]byte(http.StatusText(http.StatusNotFound)))
}
